{{
appsmith.store.errorGroups ? appsmith.store.errorGroups.map((v,ix) => {
	const mapIx = `mc${ix+1}`
	const text = `${IncorrectRegexTable.selectedRow[mapIx]}	: ${v}`
	return text
}).join('\n') : "Process Regex for Values"
}}
